import styled from "styled-components";
import { CommonButton } from "./Buttons";
// import { useState } from "react"

const NavWrapper = styled.div`
  padding-top: 50px;
  border-top: 1px solid #dcdcdc;
  border-bottom: 1px solid #dcdcdc;
  display: flex;
  justify-content: center;

  .nav--button {
    height: 30px;
    border: 2px solid #dcdcdc;
    margin-top: 5px;
    margin-bottom: 5px;
    border-radius: 10px;
    text-align: center;
    cursor: pointer;
    background-color: white;

    :last-child {
      background-color: #408ef1;
      color: white;
      font-size: 1px;
    }
  }
`;

function Nav() {
  return (
    <NavWrapper>
      <button className="nav--button">카테고리 1</button>
      <button className="nav--button">카테고리 2</button>
      <button className="nav--button">카테고리 3</button>
      <button className="nav--button">카테고리 4</button>
      <button className="nav--button">카테고리 5</button>
      <button className="nav--button">카테고리 6</button>
      <CommonButton className="nav--button">✎ 글 작성</CommonButton>
    </NavWrapper>
  );
}

export default Nav;
